import "./App.css";
import React from "react";
import Home from "./pages/home";
import { BrowserRouter as Router, Switch, Route } from "react-router-dom";

function App() {
  return (
    <Router>
      <Route exact path="/">
        <Home />
      </Route>
      <Route exact path="/about">
        <Home />
      </Route>
      <Route exact path="/contact">
        <Home />
      </Route>
      <Route exact path="/team">
        <Home />
      </Route>
    </Router>
  );
}

export default App;
